$(document).ready(function(){
    var submit_forms = $("form");
    submit_forms.submit(function(){
        submit_forms.submit(function(){
            return false;
        });
    });



    $('.rm_w_confirm').on('click',function(){
        let submit_form =  $($(this).attr('data-form'));
        let message_text = ($(this).attr('data-text'))?$(this).attr('data-text'):'';
        let title = ($(this).attr('data-titlemsg'))?$(this).attr('data-titlemsg'): 'Are you sure';
        rm_alert(submit_form, message_text, title);
    });


    rm_alert = function (submit_elem, text, title){
        // TODO USE THIS FOR ALL ACTIONS IN THE WEBSITE
        Swal.fire({
            title: title,
            text:text,
            showCancelButton: true,
            confirmButtonColor: '#3085d6',
            cancelButtonColor: '#d33',
            confirmButtonText: 'Yes',
            cancelButtonText: 'No'
        }).then((result) => {
            if (result.value) {
                submit_elem.submit();
            } else {
                return false;
            }
        });
    }
    $('[data-toggle="tooltip"]').tooltip();


   $(document).on('click', '.rm_dyn_inp',function(){
        let elem_id = $(this).attr('d-id');
        $(`#dyn_form_key_${elem_id}`).remove();

   });


   if($('.edit_key_vals').length){
        var form_iter = $('.edit_key_vals').length;
   } else{
        var form_iter = 0;
   }
   $(document).on('click','.add_dyn_inp', function(){
        form_iter++;
        let valkey = $(this).attr('data-key-name');
        var iter_plus = form_iter+1;
        let objTo = $('#key_val_fields');
        let copy_forms = $(`#dyn_form_key_1`).parent();
        objTo.append(copy_forms.html());
        objTo.find('.row:last').removeAttr('id').attr('id','dyn_form_key_'+iter_plus);
        objTo.find('.add_dyn_inp:last').removeClass('add_dyn_inp btn-primary').addClass('rm_dyn_inp btn-danger').text('-').attr('d-id',iter_plus);
        objTo.find('.value_inp:last').attr('name', `${valkey}[${iter_plus}][value]`).val('');
        objTo.find('.key_inp:last').attr('name', `${valkey}[${iter_plus}][key]`).val('');
    });

    jQuery('[data-toggle="custom-file-input"]:not(.js-custom-file-input-enabled)').each((index, element) => {
        let el = jQuery(element);
        el.addClass('js-custom-file-input-enabled').on('change', e => {
            let fileName = (e.target.files.length > 1) ? e.target.files.length + ' ' + (el.data('lang-files') || 'Files') : e.target.files[0].name;

            el.next('.custom-file-label').css('overflow-x', 'hidden').html(fileName);
        });
    });
})

var showSweetMsg = function(sweetObj, level = 'success') {
    var msg = '';
    if (level == 'error' && sweetObj.errors) {
        for (const err in sweetObj.errors) {
             msg += `${sweetObj.errors[err][0]} <br>`;
        }
    } else if(level == 'error' && sweetObj.exceptionion && sweetObj.message){
        msg = 'Something went wrong...';
    } else if(level == 'success' && sweetObj.successmsg){
        msg = sweetObj.successmsg;
    }

    if (msg) {
        Swal.fire({icon: level, html: msg , showCloseButton:true, showConfirmButton: false,});
    }
    console.log(sweetObj); // TODO RM  THIS LATER
}
